INSERT INTO `songs` VALUES (1,'https://www.youtube.com/embed/HQmmM_qwG4k',1,1,'Whole Lotta Love','00:04:48',1,'You need cooling\r Baby I\'m not fooling\r I\'m gonna send ya\r Back to schooling\r A-way down inside\r A-honey you need it\r I\'m gonna give you my love\r I\'m gonna give you my love\r Want to whole lotta love\r Want to whole lotta love\r Want to whole lotta love\r Want to whole lotta love\r You\'ve been learning\r Um baby I been learning\r All them good times baby, baby\r I\'ve been year-yearning\r A-way, way down inside\r A-honey you need-ah\r I\'m gonna give you my love, ah\r I\'m gonna give you my love, ah oh\r Whole lotta love\r Want to whole lotta love\r Want to whole lotta love\r Want to whole lotta love\r You\'ve been cooling\r And baby I\'ve been drooling\r All the good times, baby\r I\'ve been misusing\r A-way, way down inside\r I\'m gonna give ya my love\r I\'m gonna give ya every inch of my love\r I\'m gonna give ya my love\r Hey!!\r ','1970-09-09','2020-09-09 17:04:00'),(2,'https://www.youtube.com/embed/Nnu1E5Kslig',1,1,'Stairway To Heaven','00:08:01',2,'\nThere\'s a lady who\'s sure\nAll that glitters is gold\nAnd she\'s buying a stairway to Heaven\nWhen she gets there she knows\nIf the stores are all closed\nWith a word she can get what she came for\nOh oh oh oh and she\'s buying a stairway to Heaven\nThere\'s a sign on the wall\nBut she wants to be sure\n\'Cause you know sometimes words have two meanings\nIn a tree by the brook\nThere\'s a songbird who sings\nSometimes all of our thoughts are misgiving\nOoh, it makes me wonder\nOoh, it makes me wonder\nThere\'s a feeling I get\nWhen I look to the west\nAnd my spirit is crying for leaving\nIn my thoughts I have seen\nRings of smoke through the trees\nAnd the voices of those who standing looking\nOoh, it makes me wonder\nOoh, it really makes me wonder\nAnd it\'s whispered that soon, If we all call the tune\nThen the piper will lead us to reason\nAnd a new day will dawn\nFor those who stand long\nAnd the forests will echo with laughter\nIf there\'s a bustle in your hedgerow\nDon\'t be alarmed now\nIt\'s just a spring clean for the May queen\nYes, there are two paths you can go by\nBut in the long run\nThere\'s still time to change the road you\'re on\nAnd it makes me wonder\nYour head is humming and it won\'t go\nIn case you don\'t know\nThe piper\'s calling you to join him\nDear lady, can you hear the wind blow?\nAnd did you know\nYour stairway lies on the whispering wind?\nAnd as we wind on down the road\nOur shadows taller than our soul\nThere walks a lady we all know\nWho shines white light and wants to show\nHow everything still turns to gold\nAnd if you listen very hard\nThe tune will come to you at last\nWhen all are one and one is all\nTo be a rock and not to roll\nAnd she\'s buying a stairway to Heaven','1970-09-09','2020-09-09 17:04:00'),(3,'https://www.youtube.com/embed/y8OtzJtp-EM',1,1,'Immigrant Song','00:04:07',3,'Ah-ah, ah!\nAh-ah, ah!\nWe come from the land of the ice and snow\nFrom the midnight sun, where the hot springs flow\nThe hammer of the gods\nW\'ell drive our ships to new lands\nTo fight the horde, and sing and cry\nValhalla, I am coming!\nOn we sweep with threshing oar\nOur only goal will be the western shore\nAh-ah, ah!\nAh-ah, ah!\nWe come from the land of the ice and snow\nFrom the midnight sun where the hot springs flow\nHow soft your fields so green\nCan whisper tales of gore\nOf how we calmed the tides of war\nWe are your overlords\nOn we sweep with threshing oar\nOur only goal will be the western shore\nSo now you\'d better stop and rebuild all your ruins\nFor peace and trust can win the day despite of all your losing\nOoh-ooh, ooh-ooh, ooh-ooh\nOoh-ooh, ooh-ooh, ooh-ooh\nOoh-ooh, ooh-ooh, ooh-ooh\nOoh-ooh, ooh-ooh, ooh-ooh\nOoh-ooh, ooh-ooh, ooh-ooh\n','1970-09-09','2020-09-09 17:04:00'),(4,'https://www.youtube.com/embed/8Tvq1h1WJm4',2,2,'Keev Shel Lochamim','00:03:39',1,'\n\n   ,\n   \n   \n   \n\n   \n   \n  \n   , \n\